import { Component } from '@angular/core';
import { PairingServiceService } from 'src/app/pairing-service.service';

@Component({
  selector: 'app-pairing-list',
  templateUrl: './pairing-list.component.html',
  styleUrls: ['./pairing-list.component.css']
})
export class PairingListComponent {
constructor(private repositoryService: PairingServiceService) {}
Pairings: any
ngOnIt(): void{
  this.repositoryService.getWinePairing().subscribe(
  (response) => { this.Pairings = response; });
}
}
